import React from 'react'
import styles from './VictoryAreaChart.module.css'
import { ChartProps } from '../../../App'
import Label from '../../UI/Label'
import { VictoryArea, VictoryBar, VictoryBrushContainer, VictoryChart, VictoryCursorContainer, VictoryTheme, VictoryTooltip, VictoryZoomContainer } from 'victory';
import { VictoryChartProps } from '../Victory';


const VictoryAreaChart = (props: VictoryChartProps) => {
  return (
    <div className={styles.chartBox}>
    <div className={styles.chartBoxSubcontainer}>
        <Label text={props.title} className={styles.chartTitleLabel} />
        <VictoryChart

        domainPadding={{x: 10}}
        containerComponent={
            <VictoryCursorContainer
              cursorLabel={({ datum }) => `${Math.round(datum.x)}, ${Math.round(datum.y)}`}
            />
          }

      >

                <VictoryArea
                    style={{
                        data: { fill: "tomato"},

                    }}
                    x={"x"}
                    y={"y"}

                // data accessor for y values
                //y="name"
                />
            </VictoryChart>
    </div>
</div>
  )
}

export default VictoryAreaChart
